import React from 'react';
import Network from './Network';
import "./Headline.css";
import "./Filters.css";

const Vis = () => (
    <div className="Vis">
        <div className="headline">
            <h1>Network of Amazon Products Categories</h1>
        </div>
        <div className="filters">
            <text>Make a Selection of Category: </text>
            <select>Select a Category: </select>
        </div>
        <Network/>
    </div>
);
export default Vis;
